import React, { useEffect, useState } from 'react';
import '../App.css';
import axios from 'axios';
import 'react-toastify/dist/ReactToastify.css';
import { ToastContainer, toast } from 'react-toastify';
import { useParams } from 'react-router-dom';

function UserUpdate() {
    const [values, setValues] = useState({
        full_name: "",
        subject: "",
        from_sender: "",
        to_recipient: "",
        file_url: null, // เริ่มต้นเป็น null
        notes: ""
    });

    const { id } = useParams();
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [editMode, setEditMode] = useState(false);

    useEffect(() => {
        axios.get(`http://localhost:3000/documents/${id}`)
            .then(response => {
                console.log('API response:', response); // เพิ่มการพิมพ์รายละเอียดการตอบสนอง
                setValues(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('Error fetching document data:', error); // เพิ่มการพิมพ์รายละเอียดข้อผิดพลาด
                setError('Error fetching document data');
                setLoading(false);
            });
    }, [id]);
    

    const handleChange = (e) => {
        const { name, value } = e.target;
        setValues(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            console.log('Sending data to server:', values); // ตรวจสอบข้อมูลที่ส่งไป
            await axios.put(`http://localhost:3000/documents/${id}`, values);
            toast.success('Document updated successfully');
            setEditMode(false);
        } catch (error) {
            console.error('Error updating document:', error);
            setError('Error updating document');
        }
    };

    if (loading) {
        return <div className='loading'>Loading...</div>;
    }

    if (error) {
        return <div className='error'>{error}</div>;
    }

    return (
        <div>
            {editMode && (
                <div className='upload1'>
                    <form onSubmit={handleSubmit} className='edit-form'>
                        <div className='upload2'>
                            <label>ชื่อ-สกุล :</label>
                            <input
                                type='text'
                                name='full_name'
                                value={values.full_name}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className='upload2'>
                            <label>เรื่อง :</label>
                            <input
                                type='text'
                                name='subject'
                                value={values.subject}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className='upload2'>
                            <label>จาก :</label>
                            <input
                                type='text'
                                name='from_sender'
                                value={values.from_sender}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className='upload2'>
                            <label>ถึง :</label>
                            <input
                                type='text'
                                name='to_recipient'
                                value={values.to_recipient}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className='upload2'>
                            <label>หมายเหตุ :</label>
                            <textarea
                                name='notes'
                                value={values.notes}
                                onChange={handleChange}
                            />
                        </div>
                        <div className='form-actions'>
                            <button type="submit" className='submit-button'>Submit</button>
                            <button type="button" className='cancel-button' onClick={() => setEditMode(false)}>Cancel</button>
                        </div>
                    </form>
                </div>
            )}
            <ToastContainer />
        </div>
    );
}

export default UserUpdate;
